import React from 'react';
import './Footer.css';
import email from '../assets/email.png';
import github from '../assets/github.png';
import linkedin from '../assets/linkedin.png';

function Footer() {
	return (
		<footer className="footer-content-wrapper">
			<div className="footer-content">
			<div className="footer-content-name">
				<h2>Ashton Frias</h2>
			</div>
			<div className="footer-content-socials">
				<a href="#" target="_blank">
				<img className="footer-content-socials-icon" src={git} alt='email'/>
				</a>
				<a href="#" target="_blank">
				<img className="footer-content-socials-icon" src={git} alt='linkedin'/>
				</a>
				<a href="#" target="_blank">
				<img className="footer-content-socials-icon" src={git} alt='github'/>
				</a>
			</div>
			</div>
			<hr/>
			<div className="footer-content-copyright">
				<p>© 2023 Medi-Klēn, LLC</p>
			</div>
		</footer>
	);
}

export default Footer;
